import React from "react";
import {Link, useLocation} from 'react-router-dom'
import ModalWindow from "../Modal";

const NavBar = () => {
    const location = useLocation();

    return (
        <nav className="navBar">
            <ul className="navBarList">
                <li style={{ backgroundColor: location.pathname === '/pagina1' ? '#ff0000' : 'transparent' }}>
                    <Link style={{color:'black'}} to='/'>Inicio</Link>
                </li>
                <li className={location.pathname === '/Rutinas' ? 'active' : ''}>
                    <Link to='/Rutinas'>Rutinas</Link>
                </li>
                <li className={location.pathname === '/Gimnasios' ? 'active' : ''}>
                    <Link to='/Gimnasios'>Gimnasios</Link>
                </li>
            </ul>
            <div className="navBarModal">
                <ModalWindow/>
            </div>
        </nav>
    )
}

export default NavBar;
